function updateNpcUI(e){document.getElementById("target_npc_accounts").innerHTML="";const n=document.getElementById("target_npc_accounts");e.data.forEach((e=>{let t=document.createElement("div");t.textContent=`ID: ${e.user_id}, Name: ${e.spielername}, Sektor: ${e.sector}, System: ${e.system}, Punkte: ${e.score}, Kollektoren: ${e.col}`,n.appendChild(t),t=document.createElement("div"),t.innerHTML=`<span onclick="openPage(${e.user_id}, 'resource.php')">Ressourcen</span>`,t.innerHTML+=` - <span onclick="openPage(${e.user_id}, 'resource.php', {b_col: 1})">baue einen Kollektor</span>`,t.innerHTML+=` - <span onclick="openPage(${e.user_id}, 'sector.php')">Sektor</span>`,t.innerHTML+=` - <span onclick="openPage(${e.user_id}, 'military.php')">Milit√§r</span>`,t.innerHTML+=` - <span onclick="openPage(${e.user_id}, 'missions.php')">Missionen</span>`,t.innerHTML+=` - <span onclick="openPage(${e.user_id}, 'production.php')">Produktion</span>`,t.innerHTML+=` - <span onclick="openPage(${e.user_id}, 'hyperfunk.php')">Hyperfunk</span><br><br>`,n.appendChild(t)}))}function updateGameOutputUI(e){document.getElementById("target_gameoutput").innerHTML=e}async function getAllNpcUsers(){const e=await fetch("../api/",{method:"POST",headers:{"Content-Type":"application/json","X-DE-API-KEY":env_api_key},body:JSON.stringify({action:"getAllNpcUsers"})});updateNpcUI(await e.json())}async function openPage(e,n,t=Array()){await fetch("../api/",{method:"POST",headers:{"Content-Type":"application/json","X-DE-API-KEY":env_api_key},body:JSON.stringify({action:"openPage",user_id:e,filename:n,requestData:t})}).then((e=>e.text())).then((e=>{const n=new Blob([e],{type:"text/html"}),t=URL.createObjectURL(n);document.getElementById("target_gameoutput").src=t}))}getAllNpcUsers();